import React, { Component } from "react";
import AppRouter from "../../router";
import { Row, Col, Card, Button, Icon, Progress,Table } from "antd";
import LineChart from "./LineChart";
const DataSet = require("@antv/data-set");


{/* console.log(Host.loginURL);*/}

class ChartDashboard extends Component {

  constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      selectedKey: "daily"

    };

  }


  render() {

    return (
      <div>
        <div className="page-header">
          <Row type="flex" justify="space-between">
            <Col>
              <h1 className="page-heading"></h1>
            </Col>
            <Col>
              <ul className="button-actions">
                <li>
                  <div>
                    <Button type="primary" onClick={this.showModal}>
                      Create Dashboard
                    </Button>
                  </div>
                </li>
                <li>
                  <a href="">
                    <Button type="primary" ghost>
                      Save Dashboard
                    </Button>
                  </a>
                </li>
              </ul>
            </Col>
          </Row>
        </div>


        <div id="content">
          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:24, order: 5}} className="c-mb">
              <Card
                title="Line Chart"
                style={{ minHeight: "100%" }}
                bordered={false}
                className="mi-card mi-card-header-borderless mi-card-boxshadow" >
                <div>
                    <LineChart />
                </div>
              </Card>
            </Col>
          </Row>
          <Row type="flex" gutter={24}>
          </Row>

        </div>
      </div>

    );
  }
}
export default ChartDashboard;
